    console.log(transactions);
    return (
        <>
            <h3>History</h3>
            <ul className="list">
              {transactions.map(transaction => (<li className="minus">
    {transaction.text} <span>{transaction.amount}</span><button className="delete-btn">x</button>
              </li>))}
            </ul>
        </>
    )
}
